import React from 'react';
import styled from 'styled-components';

const Element = styled.div`
    display: flex;
    padding-bottom: 125px;
`;

function Wrapper(props) {
    return (
        <Element>
            {props.children}
        </Element>
    );
}

export default Wrapper;
